TITLE:
  - Test for line-based coupling between artery network (including
  - scalar transport) and PoroMultiphaseScatra-Framework.
  - 'Test for a larger network segmented from a mouse, the geometry is'
  - publicly available from
  - 'https:'
PROBLEM TYPE:
  PROBLEMTYPE: "Multiphase_Poroelasticity_ScaTra"
POROMULTIPHASESCATRA DYNAMIC:
  NUMSTEP: 2
  MAXTIME: 0.012
  TIMESTEP: 0.006
  RESULTSEVERY: 2
  COUPALGO: "twoway_monolithic"
  ARTERY_COUPLING: true
POROMULTIPHASESCATRA DYNAMIC/MONOLITHIC:
  TOLRES_GLOBAL: 1e-07
  TOLINC_GLOBAL: 1e-07
  LINEAR_SOLVER: 1
STRUCTURAL DYNAMIC:
  INT_STRATEGY: "Standard"
  DYNAMICTYPE: "OneStepTheta"
  LINEAR_SOLVER: 1
STRUCTURAL DYNAMIC/ONESTEPTHETA:
  THETA: 1
POROFLUIDMULTIPHASE DYNAMIC:
  THETA: 1
  LINEAR_SOLVER: 1
  OUTPUT_SATANDPRESS: false
  OUTPUT_SOLIDPRESS: false
  OUTPUT_POROSITY: false
  INITIALFIELD: "field_by_condition"
  INITFUNCNO: 1
  FLUX_PROJ_SOLVER: 2
POROFLUIDMULTIPHASE DYNAMIC/ARTERY COUPLING:
  MAXNUMSEGPERARTELE: 7
  ARTERY_COUPLING_METHOD: "GPTS"
  REACFUNCT_ART: "0"
  REACFUNCT_CONT: "0 0"
  SCALEREAC_CONT: "0 0"
  OUTPUT_BLOODVESSELVOLFRAC: true
  PRINT_OUT_SUMMARY_PAIRS: true
POROMULTIPHASE DYNAMIC:
  SOLVE_STRUCTURE: false
  COUPALGO: "twoway_monolithic"
SCALAR TRANSPORT DYNAMIC:
  SOLVERTYPE: "nonlinear"
  MAXTIME: 1
  NUMSTEP: 10
  THETA: 1
  INITIALFIELD: "field_by_condition"
  SKIPINITDER: true
  LINEAR_SOLVER: 1
SCALAR TRANSPORT DYNAMIC/STABILIZATION:
  STABTYPE: "no_stabilization"
  DEFINITION_TAU: "Zero"
  EVALUATION_TAU: "integration_point"
  EVALUATION_MAT: "integration_point"
SCALAR TRANSPORT DYNAMIC/NONLINEAR:
  CONVTOL: 1e-08
  ABSTOLRES: -1
SCALAR TRANSPORT DYNAMIC/ARTERY COUPLING:
  ARTERY_COUPLING_METHOD: "GPTS"
  PENALTY: 0
  REACFUNCT_ART: "11"
  SCALEREAC_ART: "-1"
  REACFUNCT_CONT: "11"
  SCALEREAC_CONT: "1"
ARTERIAL DYNAMIC:
  DYNAMICTYPE: "Stationary"
  SOLVESCATRA: true
  LINEAR_SOLVER: 1
  INITIALFIELD: "field_by_condition"
SOLVER 1:
  SOLVER: "UMFPACK"
  NAME: "solver"
MATERIALS:
  - MAT: 1
    MAT_FluidPoroMultiPhaseReactions:
      LOCAL: false
      PERMEABILITY: 0.001
      NUMMAT: 2
      MATIDS: [14, 15]
