      NUMREAC: 1
      REACIDS: [50]
  - MAT: 50
    MAT_FluidPoroSingleReaction:
      NUMSCAL: 1
      TOTALNUMDOF: 2
      NUMVOLFRAC: 1
      SCALE: [1, -1]
      COUPLING: "scalar_by_function"
      FUNCTID: 7
  - MAT: 2
