    MAT_FluidPoroVolFracPressure:
      PERMEABILITY: 0.001
      VISCOSITYLAWID: 151
  - MAT: 151
    MAT_FluidPoroViscosityLawConstant:
      VALUE: 1
  - MAT: 3
    MAT_CNST_ART:
      VISCOSITY: 1
      DENS: 1
      YOUNG: 400000
      NUE: 0.5
      TH: 1.63
      PEXT1: 0
      PEXT2: 0
  - MAT: 6
    MAT_scatra:
      DIFFUSIVITY: 2
  - MAT: 5
    MAT_matlist_reactions:
      LOCAL: false
      NUMMAT: 1
      MATIDS: [301]
      NUMREAC: 1
      REACIDS: [401]
  - MAT: 301
    MAT_scatra_multiporo_volfrac:
      DIFFUSIVITY: 0.7
      PHASEID: 0
  - MAT: 401
    MAT_scatra_reaction:
      NUMSCAL: 1
      STOICH: [-1]
      REACCOEFF: 1
      COUPLING: "by_function"
      ROLE: [4]
